import JsEncrypt from 'jsencrypt'//加密插件
Vue.prototype.$jsEncrypt = JsEncrypt;

 RSAencrypt(pas){
//实例化jsEncrypt对象

let jse = new this.$jsEncrypt;

//设置公钥

const key = global_.KEY //一般公钥是后台生成

jse.setPublicKey(key);

return jse.encrypt(pas);
